[{"location":"examples/#Examples","page":"Examples","title":"Examples","text":"","category":"section"},{"location":"examples/#Basic-examples","page":"Examples","title":"Basic examples","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"julia> using Dates, PenultimateDays\n\njulia> d = today()\n2022-06-24\n\njulia> penultimatedayofweek(d)  # second-to-last day of the week\n2022-06-25\n\njulia> penultimatedayofmonth(d)  # second-to-last day of the month\n2022-06-29\n\njulia> penultimatedayofmonth(d, Tuesday)  # second-to-last Tuesday of the month\n2022-06-21\n\njulia> penultimatedayofquarter(d)  # second-to-last day of the quarter\n2022-06-29\n\njulia> penultimatedayofquarter(d, Tuesday)  # second-to-last Tuesday of the quarter\n2022-06-21\n\njulia> penultimatedayofyear(d)  # second-to-last day of the year\n2022-12-31\n\njulia> penultimatedayofyear(d, Tuesday)  # second-to-last Tuesday of the year\n2022-12-20","category":"page"},{"location":"examples/#Extending-the-Dates-standard-library","page":"Examples","title":"Extending the Dates standard library","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"We have also extended the Dates standard library to allow specification of day for *dayof* functions:","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"julia> using Dates, PenultimateDays\n\njulia> d = today()\n2022-06-24\n\njulia> firstdayofmonth(d, Tuesday)\n2022-06-07\n\njulia> lastdayofmonth(d, Tuesday)\n2022-06-28","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"See also test/runtests.jl in the repository.","category":"page"},{"location":"#PenultimateDays.jl-Documentation","page":"Home","title":"PenultimateDays.jl Documentation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = PenultimateDays\nDocTestSetup = quote\n    using PenultimateDays\nend","category":"page"},{"location":"#Adding-PenultimateDays.jl","page":"Home","title":"Adding PenultimateDays.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"using Pkg\nPkg.add(\"PenultimateDays\")","category":"page"},{"location":"documentation/#Documentation","page":"Documentation","title":"Documentation","text":"","category":"section"},{"location":"documentation/","page":"Documentation","title":"Documentation","text":"Depth = 3","category":"page"},{"location":"documentation/","page":"Documentation","title":"Documentation","text":"CurrentModule = PenultimateDays\nDocTestSetup = quote\n    using PenultimateDays\nend","category":"page"},{"location":"documentation/#Trivial-Penultimate-Functions","page":"Documentation","title":"Trivial Penultimate Functions","text":"","category":"section"},{"location":"documentation/","page":"Documentation","title":"Documentation","text":"penultimatedayofweek(::TimeType)\npenultimatedayofmonth(::TimeType)\npenultimatedayofquarter(::TimeType)\npenultimatedayofyear(::TimeType)","category":"page"},{"location":"documentation/#Main.PenultimateDays.penultimatedayofweek-Tuple{Dates.TimeType}","page":"Documentation","title":"Main.PenultimateDays.penultimatedayofweek","text":"penultimatedayofweek(dt::TimeType) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its week.\n\n\n\n\n\n","category":"method"},{"location":"documentation/#Main.PenultimateDays.penultimatedayofmonth-Tuple{Dates.TimeType}","page":"Documentation","title":"Main.PenultimateDays.penultimatedayofmonth","text":"penultimatedayofmonth(dt::TimeType) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its month.\n\n\n\n\n\n","category":"method"},{"location":"documentation/#Main.PenultimateDays.penultimatedayofquarter-Tuple{Dates.TimeType}","page":"Documentation","title":"Main.PenultimateDays.penultimatedayofquarter","text":"penultimatedayofquarter(dt::TimeType) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its quarter.\n\n\n\n\n\n","category":"method"},{"location":"documentation/#Main.PenultimateDays.penultimatedayofyear-Tuple{Dates.TimeType}","page":"Documentation","title":"Main.PenultimateDays.penultimatedayofyear","text":"penultimatedayofyear(dt::TimeType) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its year.\n\n\n\n\n\n","category":"method"},{"location":"documentation/#Day-specific-Penultimate-Functions","page":"Documentation","title":"Day-specific Penultimate Functions","text":"","category":"section"},{"location":"documentation/","page":"Documentation","title":"Documentation","text":"penultimatedayofmonth(::TimeType, ::Int)\npenultimatedayofquarter(::TimeType, ::Int)\npenultimatedayofyear(::TimeType, ::Int)","category":"page"},{"location":"documentation/#Main.PenultimateDays.penultimatedayofmonth-Tuple{Dates.TimeType, Int64}","page":"Documentation","title":"Main.PenultimateDays.penultimatedayofmonth","text":"penultimatedayofmonth(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its month, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the penultimatedayofmonth(dt, 6) will find the penultimate Saturday of the month.  Dates also exports integer aliases Monday–Sunday, so you can write penultimatedayofmonth(dt, Saturday).\n\nSee also: Dates.dayofweek, lastdayofmonth\n\n\n\n\n\n","category":"method"},{"location":"documentation/#Main.PenultimateDays.penultimatedayofquarter-Tuple{Dates.TimeType, Int64}","page":"Documentation","title":"Main.PenultimateDays.penultimatedayofquarter","text":"penultimatedayofquarter(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its quarter, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the penultimatedayofquarter(dt, 6) will find the penultimate Saturday of the quarter.  Dates also exports integer aliases Monday–Sunday, so you can write penultimatedayofquarter(dt, Saturday).\n\nSee also: Dates.dayofweek, lastdayofquarter\n\n\n\n\n\n","category":"method"},{"location":"documentation/#Main.PenultimateDays.penultimatedayofyear-Tuple{Dates.TimeType, Int64}","page":"Documentation","title":"Main.PenultimateDays.penultimatedayofyear","text":"penultimatedayofyear(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its year, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the penultimatedayofyear(dt, 6) will find the penultimate Saturday of the year.  Dates also exports integer aliases Monday–Sunday, so you can write penultimatedayofyear(dt, Saturday).\n\nSee also: Dates.dayofweek, lastdayofyear\n\n\n\n\n\n","category":"method"},{"location":"documentation/#Dates-(Standard-Library)-Extended","page":"Documentation","title":"Dates (Standard Library) Extended","text":"","category":"section"},{"location":"documentation/","page":"Documentation","title":"Documentation","text":"firstdayofweek\nlastdayofweek\nfirstdayofmonth\nlastdayofmonth\nfirstdayofquarter\nlastdayofquarter\nfirstdayofyear\nlastdayofyear","category":"page"},{"location":"documentation/#Dates.firstdayofweek","page":"Documentation","title":"Dates.firstdayofweek","text":"firstdayofweek(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the first d-day of its week, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the firstdayofweek(dt, 6) will find the first Saturday of the week.  Dates also exports integer aliases Monday–Sunday, so you can write firstdayofweek(dt, Saturday).\n\nSee also: Dates.dayofweek\n\n\n\n\n\n","category":"function"},{"location":"documentation/#Dates.lastdayofweek","page":"Documentation","title":"Dates.lastdayofweek","text":"lastdayofweek(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the last d-day of its week, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the lastdayofweek(dt, 6) will find the last Saturday of the week.  Dates also exports integer aliases Monday–Sunday, so you can write lastdayofweek(dt, Saturday).\n\nSee also: Dates.dayofweek\n\n\n\n\n\n","category":"function"},{"location":"documentation/#Dates.firstdayofmonth","page":"Documentation","title":"Dates.firstdayofmonth","text":"firstdayofmonth(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the first d-day of its month, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the firstdayofmonth(dt, 6) will find the first Saturday of the month.  Dates also exports integer aliases Monday–Sunday, so you can write firstdayofmonth(dt, Saturday).\n\nSee also: Dates.dayofweek\n\n\n\n\n\n","category":"function"},{"location":"documentation/#Dates.lastdayofmonth","page":"Documentation","title":"Dates.lastdayofmonth","text":"lastdayofmonth(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the last d-day of its month, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the lastdayofmonth(dt, 6) will find the last Saturday of the month.  Dates also exports integer aliases Monday–Sunday, so you can write lastdayofmonth(dt, Saturday).\n\nSee also: Dates.dayofweek\n\n\n\n\n\n","category":"function"},{"location":"documentation/#Dates.firstdayofquarter","page":"Documentation","title":"Dates.firstdayofquarter","text":"firstdayofquarter(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the first d-day of its quarter, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the firstdayofquarter(dt, 6) will find the first Saturday of the quarter.  Dates also exports integer aliases Monday–Sunday, so you can write firstdayofquarter(dt, Saturday).\n\nSee also: Dates.dayofweek\n\n\n\n\n\n","category":"function"},{"location":"documentation/#Dates.lastdayofquarter","page":"Documentation","title":"Dates.lastdayofquarter","text":"lastdayofquarter(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the last d-day of its quarter, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the lastdayofquarter(dt, 6) will find the last Saturday of the quarter.  Dates also exports integer aliases Monday–Sunday, so you can write lastdayofquarter(dt, Saturday).\n\nSee also: Dates.dayofweek\n\n\n\n\n\n","category":"function"},{"location":"documentation/#Dates.firstdayofyear","page":"Documentation","title":"Dates.firstdayofyear","text":"firstdayofyear(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the first d-day of its year, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the firstdayofyear(dt, 6) will find the first Saturday of the year.  Dates also exports integer aliases Monday–Sunday, so you can write firstdayofyear(dt, Saturday).\n\nSee also: Dates.dayofweek\n\n\n\n\n\n","category":"function"},{"location":"documentation/#Dates.lastdayofyear","page":"Documentation","title":"Dates.lastdayofyear","text":"lastdayofyear(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the last d-day of its year, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the lastdayofyear(dt, 6) will find the last Saturday of the year.  Dates also exports integer aliases Monday–Sunday, so you can write lastdayofyear(dt, Saturday).\n\nSee also: Dates.dayofweek\n\n\n\n\n\n","category":"function"},{"location":"documentation/#Index","page":"Documentation","title":"Index","text":"","category":"section"},{"location":"documentation/","page":"Documentation","title":"Documentation","text":"","category":"page"}]
